import {useState, useEffect} from 'react';
import {get, remove} from '../Calls';
import {Button, Paper, Table, TableBody, TableCell, TableRow, TableContainer, TableHead, IconButton } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';
import {experientaRoute} from '../ApiRoutes';
import { useNavigate } from 'react-router-dom';


export default function ExperientaList(){

    const [rows, setRows] = useState([]);
    const [needUpdate, setNeedUpdate] = useState(false)
    const navigate = useNavigate();

    useEffect(async() => {
        let data = await get(experientaRoute);
        setRows(data);
    }, [needUpdate]);
    
    const deleteExperienta = async(id, index) => {
        await remove(experientaRoute, id);

        rows.splice(index, 1);
        setRows(rows);
        setNeedUpdate(!needUpdate);
    }




    return(
        <div>
            <div>
                <Button
                    variant='contained'
                    color="primary"
                    startIcon={<AddIcon/>}
                    onClick={() => {navigate("ExperientaEdit")}}
                >
                Adauga experienta
                </Button>
            </div>

            <br/>

            <TableContainer component={Paper}>
                <Table aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>ID Experienta</TableCell>
                            <TableCell align="left">Punct Plecare</TableCell>
                            <TableCell align="left">Punct Sosire</TableCell>
                            <TableCell align="left">Localitate</TableCell>
                            <TableCell align="left">Mijloc de Transport</TableCell>
                            <TableCell align="left">Ora Plecare</TableCell>
                            <TableCell align="left">Durata Calatorie</TableCell>
                            <TableCell align="left">Grad Aglomerare</TableCell>
                            <TableCell align="left">Observatii</TableCell>
                            <TableCell align="left">Nivel Satisfactie</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row, index) => (
                            <TableRow key={row.IDExperienta}>
                                <TableCell component="th" scope ="row">
                                    {row.IDExperienta}
                                </TableCell>
                                <TableCell align="left">{row.PunctPlecare}</TableCell>
                                <TableCell align="left">{row.PunctSosire}</TableCell>
                                <TableCell align="left">{row.Localitate}</TableCell>
                                <TableCell align="left">{row.MijlocTransport}</TableCell>
                                <TableCell align="left">{row.OraPlecare}</TableCell>
                                <TableCell align="left">{row.DurataCalatorie}</TableCell>
                                <TableCell align="left">{row.GradAglomerare}</TableCell>
                                <TableCell align="left">{row.Observatii}</TableCell>
                                <TableCell align="left">{row.NivelSatisfactie}</TableCell>
                                
                                <TableCell align="left">
                                   <IconButton onClick={() => navigate(`/ExperientaEdit/${row.IDExperienta}`)}>
                                       <EditIcon color="primary"/>
                                   </IconButton>
                                   <IconButton onClick={() => deleteExperienta(row.IDExperienta, index)}>
                                       <DeleteIcon color="secondary" />
                                   </IconButton>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    )
}
//onClick={() => navigate(`/ExperientaEdit/${row.IDExperienta}`)} pe butonul de edit
